import React from 'react';
import clsx from 'clsx';
import { makeStyles } from '@material-ui/core/styles';
import CssBaseline from '@material-ui/core/CssBaseline';
import Drawer from '@material-ui/core/Drawer';
import Box from '@material-ui/core/Box';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem'
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import IconButton from '@material-ui/core/IconButton';
import Badge from '@material-ui/core/Badge';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Link from '@material-ui/core/Link';
import MenuIcon from '@material-ui/icons/Menu';
import ChevronLeftIcon from '@material-ui/icons/ChevronLeft';
import NotificationsIcon from '@material-ui/icons/Notifications';
import Button from '@material-ui/core/Button';
import InfoIcon from '@material-ui/icons/Info';
import AccountCircle from '@material-ui/icons/AccountCircle'
import HelpIcon from '@material-ui/icons/HelpOutline'
import SearchBar from 'material-ui-search-bar';
import { secondaryListItems } from './listItems';
import Chart from './Chart';
import Deposits from './Deposits';
import Orders from './Orders';
import AdminServices from './adminServices';
import UserServices from './userServices';
import EngAndDev from './engAndDev';
import Miscellenous from './miscellaneous';
import { blue } from '@material-ui/core/colors';
import { Icon } from '@material-ui/core';

function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright Â© '}
      <Link color="inherit" href="https://material-ui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const drawerWidth = 300;

const useStyles = makeStyles(theme => ({
  root: {
    display: 'absolute',
  },
  toolbar: {
    alignItems: 'flex-start',
    color: 'blue',
    paddingRight: 10, // keep right padding when drawer closed
    paddingLeft: 20,
  },
  toolbarIcon: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'flex-end',
    padding: '0 8px',
    ...theme.mixins.toolbar,
  },
  appBar: {
    top: 105,
    zIndex: theme.zIndex.drawer + 1,
    transition: theme.transitions.create(['width', 'margin'], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
  },
  appBar1: {
    paddingTop: 40,
    zIndex: theme.zIndex.drawer + 1,
    transition: theme.transitions.create(['width', 'margin'], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
  },
  // Left App Bar shifting when open/closing drawer
  appBarShiftLeft: {
    marginLeft: drawerWidth,
    width: `calc(100% - ${drawerWidth}px)`,
    transition: theme.transitions.create(['width', 'margin'], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  // Right App Bar shifting when open/closing drawer
  appBarShiftRight: {
    marginRight: drawerWidth,
    width: `calc(100% - ${drawerWidth}px)`,
    transition: theme.transitions.create(['width', 'margin'], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  // Left and Right App Bar shifting when open/closing drawer
  appBarShiftBoth: {
    marginLeft: drawerWidth,
    marginRight: drawerWidth,
    width: `calc(100% - ${drawerWidth*2}px)`,
    transition: theme.transitions.create(['width', 'margin'], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  menuButton: {
    marginRight: 75,
  },
  menuButtonHidden: {
    display: 'none',
  },
  title: {
    flexGrow: 1,
    fontWeight: 'bold',
    alignSelf: 'flex-start',
  },
  // Drawer paper for when it is open
  drawerPaper: {
    top: 100,
    position: 'absolute',
    whiteSpace: 'nowrap',
    width: drawerWidth,
    transition: theme.transitions.create('width', {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
    elevation: 10,
  },
  // Drawer paper for when it is closed
  drawerPaperClose: {

    overflowX: 'hidden',
    transition: theme.transitions.create('width', {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
    width: theme.spacing(7),
    [theme.breakpoints.up('sm')]: {
      width: theme.spacing(9),
    },
  },
  appBarSpacer: theme.mixins.toolbar,
  content: {
    flex: 1,
    height: '100vh',
    overflow: 'auto',
  },
  container: {
    paddingLeft: 15,
    paddingTop: theme.spacing(0),
    paddingBottom: theme.spacing(0),
    width: '100hv',
  },
  // Main landing page with all the columns
  paper: {
    // controls spacing for the right and left side of the paper
    paddingLeft: 75,
    paddingRight: 75,
    // Controls the spacing for the top of the paper and the top of the screen
    paddingTop: theme.spacing(16),
    display: 'flex',
    overflow: 'auto',
    flexDirection: 'column',
    borderTop: 'darkblue',
    borderTopStyle: 'solid',
    borderWidth: '7px',
  },
  // main column size
  paper1: {
    paddingLeft: 75,
    paddingRight: 75,
    // Controls the spacing for the top of the paper and the title of each section
    padding: theme.spacing(3),
    display: 'flex',
    overflow: 'auto',
    flexDirection: 'column',
    borderTop: 'darkblue',
    borderTopStyle: 'solid',
    borderWidth: '7px',
    borderRight: 'darkblue'
  },
  fixedHeight: {
    height: 750,
  },
  // height for the miscellaneous component and Eng and Dev
  fixedHeight1: {
    height: 375,
  },
  containerHeight: {
    height: 100,
  }
}));

export default function Dashboard() {
  const classes = useStyles();
  const [openLeft, setOpenLeft] = React.useState(true);
  const [openRight, setOpenRight] = React.useState(true);
  const handleLeftDrawerOpen = () => {
    setOpenLeft(false);
  };
  const handleLeftDrawerClose = () => {
    setOpenLeft(true);
  };
  const handleRightDrawerOpen = () => {
    setOpenRight(false);
  };
  const handleRightDrawerClose = () => {
    setOpenRight(true);
  };
  const fixedHeightPaper = clsx(classes.paper, classes.fixedHeight);
  const fixedHeightPaper1 = clsx(classes.paper1, classes.fixedHeight1);
  const fixedHeightPaper2 = clsx(classes.paper1, classes.fixedHeight)
  const containerHeightPaper = clsx(classes.paper, classes.containerHeight);

  const menuCloseLeft = (open) => {
    if(open){
      handleLeftDrawerClose();
    }
    else{
      handleLeftDrawerOpen();
    }
  }
  const menuCloseRight = (open) => {
    if(open){
      handleRightDrawerClose();
    }
    else{
      handleRightDrawerOpen();
    }
  }
  return (
    <div className={classes.root}>
    <CssBaseline />
      <div/>
      {/* <AppBar position="absolute" className={clsx(classes.appBar, !openLeft && classes.appBarShiftLeft, !openRight && classes.appBarShiftRight, !openRight && !openLeft && classes.appBarShiftBoth)}>
        <Toolbar className={classes.toolbar}>
          <IconButton
            edge="start"
            color="inherit"
            aria-label="open drawer"
            onClick={handleLeftDrawerOpen}
            className={clsx(classes.menuButton, !openLeft && classes.menuButtonHidden)}
          >
            <MenuIcon />
          </IconButton>
          <Typography component="h1" variant="h6" color="inherit" noWrap className={classes.title}>

          </Typography>
          <IconButton color="inherit">
            <Badge badgeContent={4} color="secondary">
              <InfoIcon 
                onClick={handleRightDrawerOpen}
              />
            </Badge>
          </IconButton>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        openSecondary={true}
        classes={{
          paper: clsx(classes.drawerPaper, openLeft && classes.drawerPaperClose),
        }}
        openLeft={openLeft}
      >
        <div className={classes.toolbarIcon}>
          <IconButton onClick={handleLeftDrawerClose}>
            <ChevronLeftIcon />
          </IconButton>
        </div>
        <Divider />
        <List>{secondaryListItems}</List>
